import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import { getProduct } from "../services/productService";

export default class Product extends React.Component{
  state = {
    data: [],
  };
  getProduct = (props) => {
    const [data, setData] = useState({});
    useEffect(() => {
      (async () => {
        setData(await getProduct());
      })();
    }, []);
  }
  render() {
    return(
      <div>
              <table id="table">
        <thead>
          <tr>
            <th>Id</th>
            <th>Name</th>
            <th>Quantity</th>
            <th>OriginalPrice</th>
            <th>Price</th>
            <th></th>
          </tr>
        </thead>
        <tbody>
          {this.state.getProduct.data.map((d) => (
            <tr key={d.id}>
              <td>{d.id}</td>
              <td>{d.name}</td>
              <td>{d.quantity}</td>
              <td>{d.originalPrice}</td>
              <td>{d.price}</td>
              <a>Delete</a>
                <Link to={`/product/${d.id}`}>Edit</Link>
              <td>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      </div>
    );
  }
}
